import React from 'react';

class DisplayAgg extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            attribute: 'All',
            role: 'All',
            sort: 'Name',
            agg: ['None','None','None','None','None'],
        };
    }
    render(){
        return (
            <>
            {this.props.list}
            </>
        );
    }
}
export default DisplayAgg;
